  `listener_agora_uid` int NOT NULL DEFAULT '0' COMMENT '监听者的UID',
  `channel_name` varchar(255) NOT NULL DEFAULT '' COMMENT '频道名称',
  `resource_id` text COMMENT '声网返回的rid',
