CREATE TABLE `email_log` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '主键自增ID',
  `project_id` int NOT NULL DEFAULT '0' COMMENT '项目ID',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '标题',
